import React, { Component } from 'react';

export default  class AboutMe extends Component {
  render() {
    return (
        <div id="contact-wrapper">
            <div id="About-me-container">
                <h1>Omkring mig</h1>
                <p>Kandidat i idræt med speciale i sportspskologi, læreruddanne med fagene, idræt, fysik/kemi, og matematik. Har selv dyrket eliteidræt i 17 år, indenfor svømning, golf, cykelcross og mountainbike. Har arbejdet som træner, coach, mentaltræner  for landsholds atleter indenfor cykelcross, mountainbike, svømning og golf og crossfit. Har deltaget og foretaget flere forskningsforsøg, gennem københavns universitet, heriblandt EPO-forsøg, hjernetræning, højdetræning m.m. Derudover har jeg arbejdet med teamudvikling og socialpsykologi hos virksomheder. Alt dette er med til, at jeg har udviklet mine erfaringer og undervisning og kan give dig den bedste træning.</p>
            </div>
        </div>
    );
  }
}
